import React from "react";
import { NavLink } from "react-router-dom";

// IMAGENES
// import ArrowDown from "../assets/imagenes/arrowdown.svg";
// import ArrowDown from "<svg data-testid="geist-icon" fill="none" height="24" shape-rendering="geometricPrecision" stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" stroke-width="1.5" viewBox="0 0 24 24" width="24" style="color:var(--geist-foreground)"><path d="M12 5v14"/><path d="M19 12l-7 7-7-7"/></svg>";

// CSS
import "./Nav.css";

function Nav() {
  function Li({ link, nombre }) {
    return (
      <li>
        <NavLink
          className={({ isActive }) => (isActive ? "tamoactivo" : "none")}
          to={link}
          end
        >
          {nombre}
        </NavLink>
      </li>
    );
  }
  return (
    <nav>
      <ul>
        <Li nombre="Inicio" link="/" />
        <li>
          {/* Fetch <img src={ArrowDown} alt="Arrow Down" /> */}
          Fetch (<svg data-testid="geist-icon" fill="none" height="24" shape-rendering="geometricPrecision" stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" stroke-width="1.5" viewBox="0 0 24 24" width="24" style="color:var(--geist-foreground)"><path d="M12 5v14"/><path d="M19 12l-7 7-7-7"/></svg>)
          <ul>
            <Li nombre="Rick and Morty" link="/rickandmorty" />
            <Li nombre="Todo en 90 Dias" link="/todoen90dias" />
            <Li nombre="Feriados" link="/feriados" />
            <Li nombre="Crypto" link="/crypto" />
            <Li nombre="Color" link="/color" />
            <Li nombre="Usuario" link="/usuario" />
            <Li nombre="Universidades" link="/universidades" />
            <Li nombre="Perrito Random" link="/perritorandom" />
            <Li nombre="Zoo" link="/zoo" />
          </ul>
        </li>
        <Li nombre="Contacto" link="/contacto" />
      </ul>
    </nav>
  );
}

export default Nav;
